    mod = 10 ** 9 - 7

    def gcd(a, b):
        while b != 0:
            (a, b) = (b, a % b)
        return a
    gx = numbers[0]
    for num in numbers[1:]:
        gx = gcd(gx, num)
    fx = 1
    for num in numbers:
        fx = fx * num % mod
    ans = 1
    while gx > 0:
        if gx & 1:
            ans = ans * fx % mod
        fx = fx * fx % mod
        gx //= 2
    return ans

